        <div class="box">
            <form action="#" className="form">
                <h1 clas="form-title">Sign Up</h1><br/>

                <div class="form-group">
                    <input type="text" className="form-control" required />
                    <label  className="form-label">Enter Your Name</label>
                </div>
                <div class="form-group">
                    <input type="text" className="form-control" required />
                    <label  className="form-label">Enter Your Email</label>
                </div>
                <div class="form-group">
                    <input type="text" className="form-control" required />
                    <label className="form-label">Enter Your Phone</label>
                </div>
                <div class="form-group">
                    <input type="password" className="form-control" required id="txtPassword" />
                    <label className="form-label">Enter Your Password</label>
                </div>
                <div class="form-group">
                    <input type="password" className="form-control" required id="txtPassword1" />
                    <label className="form-label">Confirm Password</label>
                </div>
                <div className='form-show'>
                    <Link to='/Signuppage' className='Link'>New User</Link> 
