                        Show Password
                    </label>  
                </div><br/>

                <div class="bottom-box" style={{alignItems:"center"}}>
                    <button className="form-button" onClick={()=>{
                        navigate("/")
                    }}>Login</button>
                </div>
            </form>
        </div>
    )
}
